syntax = "proto2";

package MMPro.micromsg;

import "BaseRequest.proto";
import "VoicePieceCtx.proto";

message RegisterVoicePrintRequest {
	required BaseRequest _BaseRequest = 1;
	required uint32 _Step = 2;
	required uint32 _VoiceTicket = 3;
	required VoicePieceCtx _PieceData = 4;
	required uint32 _ResId = 5;
}
